import React from 'react';

const TestDashboard = ({ status, logs }) => {
  return (
    <div className="panel">
      <h2>Weathertop Dashboard</h2>
      <p><strong>Live Test Execution Status:</strong> {status}</p>
      <h4>Test Logs & History</h4>
      <ul>
        {logs.map((log, index) => <li key={index}>{log}</li>)}
      </ul>
    </div>
  );
};

export default TestDashboard;
